// JavaScript Document
import React from 'react';

//Material UI
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import Grid from "@material-ui/core/Grid";


//Smart Component
class StateActivities extends React.Component {
	//declaring state and new object
	state ={
		activityListing:[]
	}

//calling fetchData function
	componentDidMount(){
		this.fetchActivities();
}

//fetching API
fetchActivities(){
 fetch('https://developer.nps.gov/api/v1/activities?statecode=FL&api_key=YpbDDtsNwQRi13JXZXiN7DnEIusWnKQLsCZW11xq')
		.then(results =>{
		return results.json();
	}).then(data =>{
		let aList = data.data.map((use)=>{
			return(

			<ul>
				{use.activities.map(actvty =>{
				return(

				<li key={actvty}>{actvty.name}</li>	

					)
				})
				}

				</ul>
			)
		})
		this.setState({StateActivities:aList});
	})
}
	 render() { 
  return (
	  <div>
	  {this.state.StateActivities}		
	  </div>
  );
 }
}
export default StateActivities

const styles ={
	container:{
		marginTop:'1%',
		border:'1px solid green',
	},
}
